import React, { useState } from 'react';
import Login from './componentes/Login';
import VistaGuardia from './componentes/VistaGuardia';
import VistaSupervisor from './componentes/VistaSupervisor';
import VistaGerente from './componentes/VistaGerente';

function App() {
  const [usuario, setUsuario] = useState(null);

  if (!usuario) return <Login setUsuario={setUsuario} />;

  switch (usuario.rol) {
    case 'guardia': return <VistaGuardia usuario={usuario} />;
    case 'supervisor': return <VistaSupervisor usuario={usuario} />;
    case 'gerente': return <VistaGerente usuario={usuario} />;
    default: return <div>Rol no reconocido</div>;
  }
}

export default App;
